import React, { Component } from "react";
import "./counter.css";

class RecievedQuotes extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <button onClick={this.props.getQuote} className="button">
          GET QUOTE
        </button>
        {this.props.recievedQuotes.map((quote, index) => (
          <p>{quote.title}</p>
        ))}
      </div>
    );
  }
}

export default RecievedQuotes;
